  true,\n\t\"url\": null,\n\t\"notes\": \"The program is designed to raise student
  achievement by improving teachers' knowledge and understanding of and appreciation
  for traditional U.S. history. Grant awards will assist LEAs, in partnership with
  entities that have content expertise, to develop, document, evaluate, and disseminate
  innovative and cohesive models of professional development. By helping teachers
  to develop a deeper understanding and appreciation of U.S. history as a separate
  subject matter within the core curriculum, these programs will improve instruction
  and raise student achievement.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
